"""A string is said to be a child of a another string,
if it can be formed by deleting 0 or more characters from the other string."""

"""
    Letters cannot be rearranged. 
"""

""" Given two strings of equal length, 
    what's the longest string that can be constructed such that it is a child of both? 
"""


def commonChild(s1, s2):
    # Write your code here
    n = len(s1)
    memo_2d = [[0 for _ in range(n + 1)] for _ in range(n + 1)]

    for i in range(1, n + 1):
        for j in range(1, n + 1):
            if s1[i - 1] == s2[j - 1]:
                memo_2d[i][j] = memo_2d[i - 1][j - 1] + 1
            else:
                # Move to next charcter in s1
                delete_s1_char = memo_2d[i][j - 1]

                # Delete one from the other string
                # Move to next letter of s2
                delete_s2_char = memo_2d[i - 1][j]

                # Case: when char in s1 and s2 are not same
                # Use previous length
                skip_op = memo_2d[i - 1][j - 1]

                memo_2d[i][j] = max(delete_s1_char, delete_s2_char, skip_op)

    return memo_2d[n][n]


print(
    commonChild(
        "",
        "",
    )
)
